import React from "react";
import {ContentList} from './contentStyles';

function Content() {
    return (
        <ContentList>
            <h3>Title</h3>
            <div className="boxWrap">
                <div className="img"></div>
                <div className="username">Test 3</div>
            </div>
            <div className="desc">this is description</div>
        </ContentList>
    )
}

export default Content;
